Matthew 10

 1. And calling to himself his twelve disciples, he gave them authority over unclean spirits, to drive out, and to cure all manner of diseases and infirmities.
 2. Now the names of the twelve apostles are these: first, Simon, called Peter, and Andrew his brother;  James the son of Zebedee, and John his brother;
 3. Philip and Bartholomew;  Thomas and Matthew, the tax collector;  James the son of Alphaeus and Thaddaeus;
 4. Simon Canaanite, and Judas Iscariot, the one who betrayed him.
 5. To these twelve Jesus sent, and commanded them, saying, Ye shall not go to the Gentiles, nor enter into a city of Samaritans;
 6. but go rather to the lost sheep of the house of Israel;
 7. And going, preach, saying, The kingdom of heaven is at hand.
 8. Heal the sick, raise the dead, cleanse the lepers, cast out demons;  for free you have received, for free give.
 9. Ye shall not provide yourselves with gold, nor silver, nor copper, in your belts;
